import React from 'react';

const Sidebar = (): JSX.Element => {
    return (
        <div>
            <h1>Boards</h1>
            <ul>
                <li>Board 1</li>
                <li>Board 2</li>
                <li>Board 3</li>
            </ul>
        </div>
    );
}

export default Sidebar;
